import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Console from "./Components/Console";
import Button from "./Components/Button";

const e = React.createElement;
class App extends React.Component {
  constructor(props) {
    super(props);
    this.clearConsole = this.clearConsole.bind(this);
    this.addConsoleValue = this.addConsoleValue.bind(this);
    this.state = {
      console: ["Nothing on console..."],
      epochs: 30
    };
  }

  componentDidMount() {}

  clearConsole() {
    this.setState({
      console:[]
    });
  }
  addConsoleValue() {
    const date = new Date();
    this.setState({
      console:[...this.state.console, "[" + date.toLocaleTimeString() + "]:Training..."]
    });
  }


  render() {
    return e(
      "div",
      { className: "container" },
      e(
        "div",
        { className: "row" },
        e(
          "div",
          { className: "col-md-6" },
          e("p", null, "Console"),
          <Console
            console={this.state.console}
          />,
          <Button label="Add" onClick={this.addConsoleValue} />,
          <Button label ="Clear" onClick={this.clearConsole} />
        ),
        e("div", { className: "col-md-6" },
         e("p", {}, "Train"),
         e('p',null,'Default Breast Cancer Dataset'),
         e('input',{type:'radio',value:'Trained model',checked:true}),
         e('label',null,'Test data')
         )
      )
    );
  }
}

export default App;
